import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faDrumstickBite, faFish, faAppleAlt, faCarrot, faCheese, faShoppingBag, faLeaf, faSnowflake, faBoxes, faWineBottle, faCandyCane } from '@fortawesome/free-solid-svg-icons';
import "./ManageShoppingFoodList.css";

const ManageShoppingFoodList = () => {
    const [shoppingLists, setShoppingLists] = useState([]);
    const [currentIndex, setCurrentIndex] = useState(0);
    const [expandedItems, setExpandedItems] = useState([]);

    useEffect(() => {
        fetchShoppingLists();
    }, []);

    const fetchShoppingLists = async () => {
        try {
            const response = await axios.get('http://localhost:5000/shopping-list');
            setShoppingLists(response.data);
            setExpandedItems(new Array(response.data.length).fill(false));
        } catch (error) {
            console.error('Error fetching shopping lists:', error);
        }
    };

    const handleDeleteList = async (listId) => {
        try {
            await axios.delete(`http://localhost:5000/shopping-list/${listId}`);
            fetchShoppingLists();
        } catch (error) {
            console.error('Error deleting shopping list:', error);
        }
    };

    const handleNextList = () => {
        setCurrentIndex(currentIndex === shoppingLists.length - 1 ? 0 : currentIndex + 1);
    };

    const handlePrevList = () => {
        setCurrentIndex(currentIndex === 0 ? shoppingLists.length - 1 : currentIndex - 1);
    };

    const toggleExpandItem = (listIndex, itemIndex) => {
        const newExpandedItems = [...expandedItems];
        newExpandedItems[listIndex] = !newExpandedItems[listIndex];
        setExpandedItems(newExpandedItems);
    };

    const getCategoryIcon = (category) => {
        switch (category) {
            case 'Meat':
                return faDrumstickBite;
            case 'Fish and Seafood':
                return faFish;
            case 'Fruits':
                return faAppleAlt;
            case 'Vegetables':
                return faCarrot;
            case 'Dairy Products':
                return faCheese;
            case 'Dry Goods':
                return faShoppingBag;
            case 'Fresh Products':
                return faLeaf;
            case 'Frozen Foods':
                return faSnowflake;
            case 'Grocery':
                return faBoxes;
            case 'Beverages':
                return faWineBottle;
            case 'Snacks':
                return faCandyCane;
            default:
                return null;
        }
    };

    return (
        <div className="ms-body">
            <div className="ms-background"></div>
            <h1 className="ms-title">Shopping Lists</h1>
            {shoppingLists.length > 0 && (
                <div className="ms-section">
                    <ul className="ms-lists">
                        {shoppingLists.map((list, listIndex) => (
                            <li key={list._id} className={listIndex === currentIndex ? "ms-list active" : "ms-list"}>
                                <h3 className="ms-list-title">{list.listTitle}</h3>
                                <ul className="ms-items">
                                    {list.items.map((item, itemIndex) => (
                                        <li key={`${list._id}-${itemIndex}`} className="ms-item">
                                            <div className="ms-item-info">
                                                <div className="ms-item-icon">
                                                    {getCategoryIcon(item.category) &&
                                                        <FontAwesomeIcon icon={getCategoryIcon(item.category)} />}
                                                </div>
                                                <div className="ms-item-details">
                                                    <p className="ms-item-name">{item.name}</p>
                                                    <p className="ms-item-quantity">Quantity: {item.quantity}</p>
                                                </div>
                                                {expandedItems[listIndex] && (
                                                    <div className="ms-item-details-expanded">
                                                        {/* Affichez ici les détails supplémentaires de l'élément */}
                                                    </div>
                                                )}
                                            </div>
                                        </li>
                                    ))}
                                </ul>
                                <div className="frame">
                                    {list.items.length > 4 && (
                                        <button className="custom-btn ms-show-more-btn" onClick={() => toggleExpandItem(listIndex)}>
                                            {expandedItems[listIndex] ? 'Show Less' : 'Show More'}
                                        </button>
                                    )}
                                    <button className="custom-btn ms-remove-btn" onClick={() => handleDeleteList(list._id)}>Delete</button>
                                </div>
                            </li>
                        ))}
                    </ul>
                    <div className="navigation-buttons">
                        <button className="custom-btn" onClick={handlePrevList}>Previous</button>
                        <button className="custom-btn" onClick={handleNextList}>Next</button>
                    </div>
                </div>
            )}
        </div>
    );
};

export default ManageShoppingFoodList;
